  import {Blog, Footer, Features, Header, possibility,WhatGPT3} from './components';

  import {Article, Brand, CTA, Navbar} from './components';


  const App = () => {
    return (
      <div className="App">
        <div className="gradient_bg">
          <Navbar />
          <Header />

        </div>
        <Brand />
        <whatGPT3 />
      </div>
    )
  }
  
  export default App
